sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  try{
    var vcnUtil = new OracleVirtualCloudNetworkUtils();
    vcnUtil.validateInputVariables(inputs, outputs);
    vcnUtil.validateMandatoryVariables(inputs,["tenancyId"]);
     if(inputs.tenancyId && inputs.compartmentId){
		outputs.compartmentid = inputs.compartmentId;
    }
    else if(inputs.tenancyId){
    	outputs.compartmentid = inputs.tenancyId;
    }

  }
  catch(ex){
    throw new Error("Mandatory fields should be provided");
  }
})(inputs, outputs);

